  \"Relationships among floodplain water levels, instream dissolved oxygen conditions,
  and streamflow in the Lower Roanoke River, 1997-2001\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 11,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:36.048508\",\n\t\"name\": \"relationships-among-floodplain-water-levels-instream-dissolved-oxygen-conditions-and-1997-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The lower Roanoke River corridor in North
  Carolina contains a floodplain of national significance. Data from a network of
  1 streamflow-measurement site, 13 river-stage sites, 13 floodplain water-level sites
  located along 4 transects, and 5 in situ water-quality monitoring sites were used
  to characterize temporal and spatial variations of floodplain and river water levels
  during 1997 u2013 2000 and to describe dissolved oxygen conditions in the lower
  Roanoke River for the period 1998 u2013 2001. Major differences in the relation
  of floodplain inundation to flow occurred both among sites at a given transect and
  among transects. Several floodplain sites were inundated for the full range of flow
  conditions measured during the study. These included one site on the Big Swash transect
  (at about river kilometer 119); one site on the Broadneck Swamp transect (river
  kilometer 97), which was inundated 91 percent of the time during the study; one
  site on the Devils Gut transect (river kilometer 44), which was inundated throughout
  the study; and three sites on the Cow Swamp transect (near river kilometer 10).
  Dissolved-oxygen concentrations typically decrease with increasing distance from
  Roanoke Rapids Dam. During the 1998 u2013 2001 study period, the median dissolved-oxygen
  concentration at Halifax (river kilometer 187), the upstream most station, was 8.4
  milligrams per liter, and the median concentration at the downstream-most station
  (NC-45, bottom sensor; river kilometer 2.6) was 6.6 milligrams per liter.\",\n\t\"license_title\":
